import React from 'react';
import netflix from '../Images/netflix.jpg';

const Home = () => {
    return (
        <div >
            <div >
                <div className=' mx-10 flex items-center just h-full px-20 py-20 '>
                    <img src={netflix} alt=""  />
                </div>
            </div>
        </div>
    )
}

export default Home
